import React from 'react'
import './IndexPage.css'
import UploadForm from '../../components/UploadForm/UploadForm';
import Resume from '../../components/Resume/Resume';
import { ImageList, ImageListItem, ImageListItemBar, Box, Paper, Grid, experimentalStyled as styled } from "@material-ui/core";
import { Link } from 'react-router-dom'

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(2),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));


class IndexPage extends React.Component {
  state = {
      resumes: []
  }

  getResumes = async () => {
    await fetch("/api/resumes").then((res) => res.json()).then(data => this.setState({resumes: data}))
  }

  componentDidMount() {
    this.getResumes()
  }


  render() {
    return (
      <div>
          <Box sx={{ flexGrow: 1 }}>
          <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }}>
            {Array.from(Array(6)).map((_, index) => (
              <Grid item xs={2} sm={4} md={4} key={index}>
                <Item>xs=2</Item>
              </Grid>
            ))}
          </Grid>
        </Box>
      </div>

        // <main className="IndexPage">
        //     {this.state.resumes.length ? 
        //   this.state.resumes.map(p => (
        //   <Resume resume={p} getResumes={this.getResumes}/>
        //     ))
        //       :
        //     <h1>No Resumes</h1>
        //   }
        // </main>
    );
  }
}


export default IndexPage;
